type Operator = "plus" | "minus";
// type Caculator = (operator: Operator, numbers: Array<number>) => number;
interface Caculator {
  (operator: Operator, numbers: Array<number>): number;
  plus: (numbers: Array<number>) => number;
  minus: (numbers: Array<number>) => number;
}

declare const caculator: Caculator;

export default caculator;
